            <div class="card-body">
                <h5 class="card-title">Special title treatment</h5>
                <p class="card-text">Uygulamayı beğendiyseniz, uygulamanın ayakata kalmasını ve uygulamanın güncellenmesi istiyorsanız destek olabilirsiniz.</p>
